import React from "react";

import axios from "axios";
import { useState, useEffect } from "react"
import { useParams } from "react-router-dom";


function App() {
  const { id } = useParams();

  const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/" + `${id}` + "/question";

  useEffect(() => {
    const response =  axios.get(QUIZ_API_BASE_URL);
    this.setState({ quiz: response.data, isLoading: false });
  }
  )

  return (
    <div>
      <ul>
        <li >
          <span style={{
            "marginLeft": "50px",
            "fontSize": "23px"
          }}>{this.quiz.text}</span>
        </li>
      </ul>
    </div>
  );
}

export default App
